f=\"https:\/\/ru.wikipedia.org\/wiki\/1791_%D0%B3%D0%BE%D0%B4\" title=\"1791 \u0433\u043e\u0434\">1791<\/a>&#160;\u2014 \u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BC%D0%BD\" title=\"\u0413\u0438\u043c\u043d\">\u0433\u0438\u043c\u043d<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%BE%D0%BC_%D0%BF%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B,_%D1%80%D0%B0%D0%B7%D0%B4%D0%B0%D0%B2%D0%B0%D0%B9%D1%81%D1%8F!\" title=\"\u0413\u0440\u043e\u043c \u043f\u043e\u0431\u0435\u0434\u044b, \u0440\u0430\u0437\u0434\u0430\u0432\u0430\u0439\u0441\u044f!\">\u0413\u0440\u043e\u043c \u043f\u043e\u0431\u0435\u0434\u044b, \u0440\u0430\u0437\u0434\u0430\u0432\u0430\u0439\u0441\u044f!<\/a>\u00bb \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%B7%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9E%D1%81%D0%B8%D0%BF_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u0437\u043b\u043e\u0432\u0441\u043a\u0438\u0439, \u041e\u0441\u0438\u043f \u0410\u043d\u0442\u043e\u043d\u043e\u0432\u0438\u0447\">\u041e. \u041a\u043e\u0437\u043b\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a> \u043d\u0430 \u0441\u043b\u043e\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D0%B8%D0%BD,_%D0%93%D0%B0%D0%B2%D1%80%D0%B8%D0%B8%D0%BB_%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u0435\u0440\u0436\u0430\u0432\u0438\u043d, \u0413\u0430\u0432\u0440\u0438\u0438\u043b \u0420\u043e\u043c\u0430\u043d\u043e\u0432\u0438\u0447\">\u0413. \u0414\u0435\u0440\u0436\u0430\u0432\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794<\/a>&#160;\u2014 \u041f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 \u043a\u043e\u0440\u0440\u0443\u043f\u0446\u0438\u0438 \u043a\u0430\u0437\u043d\u0451\u043d \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0443\u0447\u0451\u043d\u044b\u0439, \u043e\u0442\u0435\u0446 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u0445\u0438\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B2%D1%83%D0%B0%D0%B7%D1%8C%D0%B5,_%D0%90%D0%BD%D1%82%D1%83%D0%B0%D0%BD_%D0%9B%D0%BE%D1%80%D0%B0%D0%BD\" title=\"\u041b\u0430\u0432\u0443\u0430\u0437\u044c\u0435, \u0410\u043d\u0442\u0443\u0430\u043d \u041b\u043e\u0440\u0430\u043d\">\u0410\u043d\u0442\u0443\u0430\u043d \u041b\u0430\u0432\u0443\u0430\u0437\u044c\u0435<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1801_%D0%B3%D0%BE%D0%B4\" title=\"1801 \u0433\u043e\u0434\">1801<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I<\/a> \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043e\u0442 \u0442\u0438\u0442\u0443\u043b\u0430 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D1%8C%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u041c\u0430\u043b\u044c\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u041c\u0430\u043b\u044c\u0442\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0434\u0435\u043d\u0430<\/a>, \u043f\u043e\u0432\u0435\u043b\u0435\u043b \u0443\u0431\u0440\u0430\u0442\u044c \u043c\u0430\u043b\u044c\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u0440\u0435\u0441\u0442 \u0441 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0433\u0435\u0440\u0431\u0430 \u0438 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%98%D0%BE%D0%B0%D0%BD%D0%BD%D0%B0_%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_(%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u041e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0418\u043e\u0430\u043d\u043d\u0430 \u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u043e\u0433\u043e (\u0420\u043e\u0441\u0441\u0438\u044f)\">\u043e\u0440\u0434\u0435\u043d \u0421\u0432. \u0418\u043e\u0430\u043d\u043d\u0430 \u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u043e\u0433\u043e<\/a> \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430 \u043e\u0440\u0434\u0435\u043d\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1838_%D0%B3%D0%BE%D0%B4\" title=\"1838 \u0433\u043e\u0434\">1838<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D1%85%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0445\u0430\u0440\u0442\u0438\u044f\">\u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0445\u0430\u0440\u0442\u0438\u044f<\/a>\u00bb&#160;\u2014 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u0439 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u043e\u043b\u0435\u0442\u0430\u0440\u0438\u0430\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1842_%D0%B3%D0%BE%D0%B4\" title=\"1842 \u0433\u043e\u0434\">1842<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%81%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0\" title=\"\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430\">\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430<\/a> (\u0424\u0440\u0430\u043d\u0446\u0438\u044f), \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u043d\u0435 \u043c\u0435\u043d\u0435\u0435 55 \u0447\u0435\u043b