0%BE%D1%80%D0%B4\" title=\"\u041f\u0435\u043c\u0431\u0435\u0440\u0442\u043e\u043d, \u0414\u0436\u043e\u043d \u041a\u043b\u0438\u0444\u0444\u043e\u0440\u0434\">\u0414\u0436\u043e\u043d\u043e\u043c \u041f\u0435\u043c\u0431\u0435\u0440\u0442\u043e\u043d\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0439<\/a> \u043f\u0435\u0440\u0435\u0434\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D0%B2%D0%B0%D0%BD%D1%8C\" title=\"\u0422\u0430\u0439\u0432\u0430\u043d\u044c\">\u0422\u0430\u0439\u0432\u0430\u043d\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u043e\u0441\u044c \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u043e\u0435 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0435 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%BE%D0%BA%D0%B0%D0%BC,_%D0%94%D0%B6%D0%BE%D1%88%D1%83%D0%B0\" title=\"\u0421\u043b\u043e\u043a\u0430\u043c, \u0414\u0436\u043e\u0448\u0443\u0430\">\u0414\u0436\u043e\u0448\u0443\u0430 \u0421\u043b\u043e\u043a\u0430\u043c\u0430<\/a> \u043d\u0430 \u0448\u043b\u044e\u043f\u0435 \u00ab\u0421\u043f\u0440\u044d\u0439\u00bb.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u0418\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0432\u0443\u043b\u043a\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD-%D0%9F%D0%B5%D0%BB%D0%B5\" class=\"mw-redirect\" title=\"\u041c\u043e\u043d-\u041f\u0435\u043b\u0435\">\u041c\u043e\u043d-\u041f\u0435\u043b\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0430\u0440\u0442\u0438\u043d\u0438\u043a\u0430\">\u041c\u0430\u0440\u0442\u0438\u043d\u0438\u043a\u0430<\/a>), \u043f\u0440\u0438\u0432\u0435\u0434\u0448\u0435\u0435 \u043a \u0433\u0438\u0431\u0435\u043b\u0438 \u043e\u043a\u043e\u043b\u043e 20 000 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c<\/a> \u00ab\u041b\u0435\u0431\u043e\u0434\u0438\u00bb \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 37&#160;\u043a\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>, \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%BD%D0%B3%D0%BC%D1%83%D1%82\" class=\"mw-redirect\" title=\"\u0413\u0440\u0438\u043d\u0433\u043c\u0443\u0442\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u043c \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0438\u0447\u0435\u043c \u0413\u0440\u0438\u043d\u0433\u043c\u0443\u0442\u043e\u043c<\/a> \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b-\u043f\u0430\u0442\u0440\u0438\u043e\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f, \u0447\u0435\u0440\u043d\u043e\u0441\u043e\u0442\u0435\u043d\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%9C%D0%BE%D0%BD%D0%B0%D1%80%D1%85%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u041c\u043e\u043d\u0430\u0440\u0445\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u041f\u0430\u0440\u0442\u0438\u044f\">\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u041c\u043e\u043d\u0430\u0440\u0445\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u041f\u0430\u0440\u0442\u0438\u044f<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%B8_%D0%93%D0%BE%D0%B3%D0%BE%D0%BB%D1%8E_%D0%B2_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B5\" title=\"\u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0438 \u0413\u043e\u0433\u043e\u043b\u044e \u0432 \u041c\u043e\u0441\u043a\u0432\u0435\">\u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u041d.&#160;\u0412.&#160;\u0413\u043e\u0433\u043e\u043b\u044e<\/a> \u0440\u0430\u0431\u043e\u0442\u044b \u0441\u043a\u0443\u043b\u044c\u043f\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043d\u0434\u0440\u0435\u0435\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0438\u0447\">\u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u044d\u043c\u0438\u0433\u0440\u0430\u043d\u0442\u044b \u043e\u0442\u043a\u0440\u044b\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\">\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D0%BD%D1%8C%D0%B8_%D0%B1%D0%B5%D0%B3%D0%B0\" title=\"\u0422\u0430\u0440\u0430\u043a\u0430\u043d\u044c\u0438 \u0431\u0435\u0433\u0430\">\u0442\u0430\u0440\u0430\u043a\u0430\u043d\u044c\u0438 \u0431\u0435\u0433\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0412 \u043f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u0435 \u00ab\u0412\u0435\u0447\u0435\u0440\u043d\u0438\u0439 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u00bb \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0430 \u0433\u043b\u0430\u0432\u0430 \u00ab\u0413\u0440\u044d\u0439\u00bb \u0438\u0437 \u0440\u043e\u043c\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%93%