\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%8D%D1%80%D0%B4,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4\" title=\"\u0411\u044d\u0440\u0434, \u0420\u0438\u0447\u0430\u0440\u0434\">\u0420\u0438\u0447\u0430\u0440\u0434 \u0411\u044d\u0440\u0434<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%BD%D0%B5%D1%82%D1%82,_%D0%A4%D0%BB%D0%BE%D0%B9%D0%B4\" title=\"\u0411\u0435\u043d\u043d\u0435\u0442\u0442, \u0424\u043b\u043e\u0439\u0434\">\u0424\u043b\u043e\u0439\u0434 \u0411\u0435\u043d\u043d\u0435\u0442\u0442<\/a> \u043d\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0435 \u00ab\u0416\u043e\u0437\u0435\u0444\u0438\u043d\u0430 \u0424\u043e\u0440\u0434\u00bb \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0439 \u0430\u0432\u0438\u0430\u043f\u0435\u0440\u0435\u043b\u0451\u0442 \u043d\u0430\u0434 \u0421\u0435\u0432\u0435\u0440\u043d\u044b\u043c \u043f\u043e\u043b\u044e\u0441\u043e\u043c. \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u044d\u0442\u0430 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u043f\u043e\u0434\u0432\u0435\u0440\u0433\u043b\u0430\u0441\u044c \u0441\u043e\u043c\u043d\u0435\u043d\u0438\u044e \u0438 \u0431\u044b\u043b\u0430 \u043e\u043f\u0440\u043e\u0432\u0435\u0440\u0433\u043d\u0443\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u043e \u043e\u043f\u0440\u044b\u0441\u043a\u0438\u0432\u0430\u043d\u0438\u0435 \u043b\u0435\u0441\u043e\u0432 \u0438 \u043f\u043